import React, { Component } from 'react';

class Item extends Component {
  constructor (props) {
    super(props)
  }
  render () {
    return (
      <li key={this.props.index} onClick={() => {
        this.props.deleteItem(this.props.index)
      }}>{this.props.content}</li>
    )
  }
}

export default Item;
